INSERT INTO `qa_messages` (`id`, `topic_id`, `sender_id`, `read_at`, `content`, `created_at`, `updated_at`) VALUES
(4, 3, 76, '2022-05-05 01:18:38', 'Minta admin tambah nama pelajar baru (Puan Marina CQ582), belum ada dalam sistem, jazakallahu khoir', '2022-05-04 05:59:22', '2022-05-05 01:18:38'),
(5, 3, 1, '2022-06-02 04:20:08', 'done', '2022-05-05 01:19:20', '2022-06-02 04:20:08'),
(6, 4, 238, '2022-07-26 05:51:52', 'Assalamualaikum Admin,\r\n\r\nUntuk makluman admin, saya telah kreditkan Pembayaran Yuran Ngaji untuk anak saya yg tersebut di atas pada 1/6/2022 Ref#604642750 Cimb Bank.   Tetapi dlm sistem masih lagi UNPAID.  Transaksi slip pembayaran telah saya wasaap ke no hp:011-62218429 pada tarikh yg sama pembayaran telah dibuat.\r\n\r\nMohon maklum dan respon email ini.\r\n\r\nSaya juga ingin membuat pembayaran untuk Bulan Julai 2022 tetapi tiada list untuk bln julai?', '2022-07-01 03:37:53', '2022-07-26 05:51:52'),
(7, 4, 1, '2022-08-01 03:11:08', 'Maklum. Terima kasih Puan', '2022-07-26 05:52:22', '2022-08-01 03:11:08'),
(8, 5, 152, '2022-10-12 06:09:54', 'Assalamualaikum ustaz, \r\nMaaf saya pmemintavjasa baik ustaz untuk mengantikan ustazah Fatini berikutan mingguni minggu terakhir beliau mengajar anak saya kerana ustazah tersebut sambung belajar..\r\n\r\nDiharap Ustaz dapat mengantikan ustazah pada kadar segera\r\n\r\nTerima Kasih', '2022-10-11 10:50:14', '2022-10-12 06:09:54'),
(9, 6, 152, '2022-10-26 09:25:46', 'Assalamualaikum ustaz, \r\nMaaf saya pmemintavjasa baik ustaz untuk mengantikan ustazah Fatini berikutan mingguni minggu terakhir beliau mengajar anak saya kerana ustazah tersebut sambung belajar..\r\n\r\nDiharap Ustaz dapat mengantikan ustazah pada kadar segera\r\n\r\nTerima Kasih', '2022-10-11 10:50:14', '2022-10-26 09:25:46'),
(10, 7, 197, '2022-10-26 09:21:15', 'Assalamualaikum, sy puan Aisyah. Saya ingin memaklumkan yang kedua anak saya Luqman dan Aleesya akan berhenti mengaji dengan ustazah Nurul mulai 1st Nov 2022. Mereka akan ke pusat mengaji berhampiran. Terima kasih.', '2022-10-26 03:08:52', '2022-10-26 09:21:15'),
(11, 7, 1, '2022-10-27 01:57:08', 'Waalaikumussalam wbt\r\nBaik Puan.\r\n\r\nTerima kasih diatas kepercayaan yang telah diberikan kepada kami dalam mengendalikan kelas megaji. Jika puam perlukan khidmat kami buat masa akan datang bolrh kembali hubungi kami. Jika ada komen untuk kami nenambahbaik boleh kongsikan Terima kasih', '2022-10-26 09:24:21', '2022-10-27 01:57:08');
